import React from 'react'

function Namelist() {
    const names=["Shubham","Pratim","Disha"];
    const op=names.map((x)=>{
        return(
            <h2>x</h2>
        )}
    );
    return (
        <div>
        {op}
        </div>
    )
}
export default Namelist;
